import styled from "styled-components";

export const HomeHeader = styled.header`
  width: 100%;
  height: 80px;
  border: solid white;
  display: flex;
  align-items: center;
  justify-content: space-around;

  button {
    width: 4%;
    height: 32px;
  }
`;
